import React from "react";

class Header extends React.Component {
    render() {
        return (
            <Header className="top">
             <h1> 
             Catch 
             <span>
                <span className="of">of</span>
                <span className="the">The</span>
             </span>

             Day</h1>
             <h3 className="tagline">
                <span>Fresh Day </span>
             </h3>
            </Header>

        )
    }
}

export default Header;
